// ==UserScript==
// @name        BabanChat
// @namespace   baban
// @include     http://babangida.com/
// @version     0.14
// @grant       GM_xmlhttpRequest
// @grant       GM_addStyle
// @run-at      document-start
// @description Бабангидовый чат
// @downloadURL https://update.greasyfork.org/scripts/13609/BabanChat.user.js
// @updateURL https://update.greasyfork.org/scripts/13609/BabanChat.meta.js
// ==/UserScript==
window.stop();
var I = {
	baban: 'data:image/png;base64,',
	banan:  'data:image/png;base64,'
}
var H = {
  sc2tv: 119735,
  twitch: 'babangidatijani',
  goodgame: '29909'
};
window.onkeypress = function(e) {
	e = e.keyCode;
	if(e === 13) {
		e = eval(window.prompt())//.split(' ')
	}
}
GM_addStyle('body{overflow:hidden;margin:0;background-color:black;color:white;font-family:Marmelad,Verdana,monospace;font-size:24px}\
@keyframes fade{from{opacity:0}to{opacity:1}}\
.message{border-radius:30px;animation:fade 500ms 1 ease-out;background-color:#002000;animation-fill-mode:forwards;padding:16px 6px 12px 20px;margin-top:4px}\
#wrapper{width:400px;margin:0 auto;overflow-x:hidden}\
#chat{}\
.text{}\
.sc2tv{color:DeepSkyBlue;background-image:url("http://sc2tv.ru/favicon.ico");background-repeat:no-repeat;background-position:0 50%}\
.twitch{color:DarkViolet;background-image:url("http://www.twitch.tv/favicon.ico");background-repeat:no-repeat;background-position:0 50%}\
.goodgame{color:DodgerBlue;background-image:url("http://goodgame.ru/images/icons/favicon.png");background-repeat:no-repeat;background-position:0 50%}\
.smile{width:26px;vertical-align:text-bottom}\
.nick{font-weight:bold;padding-left:18px}\
.nick:after{content:": ";color:white;font-weight:normal}\
.to:after{content:", ";color:white;font-weight:normal}\
.to{font-weight:bold}');
var D = document, C = D.createElement.bind(D);
D.querySelector('html').appendChild(C('body'));
D.title = 'Babangida chat';
var B = D.body.appendChild.bind(D.body);
var A = {
	wrapper: C('DIV'),
  div: C('DIV'),
  init: function() {
    this.wrapper.id = 'wrapper';
		this.wrapper.style.height = window.innerHeight + 'px';
    this.div.id = 'chat';
    //this.div.innerHTML='<div></div>';
		this.wrapper.appendChild(this.div);
    B(this.wrapper);
    this.connect('f');
    this.connect('t');
    this.connect('g')
  },
  addMsg: function(from,msg,part,type) {
    let nick = C('SPAN'), text = C('SPAN'), div = C('DIV'), to = C('SPAN');
    nick.className = type + ' nick';
    text.className = 'text';
    div.className = 'message';
		div.style.backgroundImage = 'url(' + I.banan + '), linear-gradient(45deg, transparent, orange)'
		div.style.backgroundPosition = '100% 0, 0 0';
		div.style.backgroundRepeat = 'no-repeat, no-repeat';
    nick.textContent = from;
    text.innerHTML = msg;
    div.appendChild(nick);
    if(part !== null) {
      to.className = 'to';
      to.textContent = part;
      div.appendChild(to)
    }
    div.appendChild(text);
    //this.div.insertBefore(div,this.div.children[0])
    this.div.appendChild(div);
		this.wrapper.scrollTop=this.div.offsetHeight
  },
  sockConnect: {
    f: {
      smiles: {},
      ssmiles: { baban: I.baban },
      rgxpChat: {
        smile: /:([a-z0-9]*?):/gi,
        link: /([a-z]{2,5}:\/\/[а-яa-z0-9]+?\.[а-яa-z0-9]{2,}\/?[^\s]*)/gi
      },
      smileReplacer: function(str,p1){
        if(this.smiles[p1]) return '<img class="smile" src="https://funstream.tv/build/images/smiles/' + this.smiles[p1] + '">';
        if(this.ssmiles[p1]) return '<img class="smile" src="' + this.ssmiles[p1] + '">';
        return p1
      },
      rep: {},
      timeout: (new Date).getTime(),
      connect: function() {try{
        this.socket = new WebSocket('wss://funstream.tv/socket.io/?EIO=3&transport=websocket');
        //this.socket.onerror=function(e){console.log('error',e);alert(e)}.bind({w:w});
        this.socket.onmessage = function(e){ this.message(e) }.bind(this);
        this.interval.ping = window.setInterval(function() { this.socket.send('2') }.bind(this), 30000);
        this.interval.timeout = window.setInterval(function() {
          if((new Date).getTime() - this.timeout > 45000){
            console.log('funstream reconnect');
            this.socket.close();
            window.clearInterval(this.interval.ping);
            window.clearInterval(this.interval.timeout);
            this.connect()
          }
        }.bind(this), 45000);
      }catch(e){console.log(e)}},
      socket: null,
      interval: { ping: null, timeout: null },
      am: function(msg, chat) {try{
        let to = null, text;
        if(msg.to !== null) to = msg.to.name;
        text = msg.text.replace(chat.rgxpChat.link, '<a target="_blank" href="$1">&lt;link&gt;</a>').replace(chat.rgxpChat.smile, chat.smileReplacer.bind(chat));
        this.addMsg(msg.from, text, to, 'sc2tv')
      }catch(e){console.log(e)}},
      message: function(msg) {try{
        //console.log(msg)
        let r = msg.data.match(/(\d{1,4})(.*)/);
        let code=r[1];
        if(r[2] !== '') r[2] = JSON.parse(r[2]);
        if(code === '0') this.socket.send('420' + JSON.stringify(['/chat/join', {'channel': 'stream/' + H.sc2tv}]));
        else if(code === '3') this.timeout = (new Date).getTime();
        else if(code === '42'){
          let z=r[2][0];
          if(z === '/chat/message'){
            let s = r[2][1];
            let sid = s.id.toString();
            if(!this.rep.hasOwnProperty(sid)) {
              this.am.call(A, {from: s.from.name, text: s.text, to: s.to}, this);
              this.rep[sid] = 1
            }
          }
        }
        //this.am.call(A, {from: 'me', text: 'no :peka: z', to: {name: 'jo'}}, this);
      }catch(e){console.log(e)}}
    },
    t: {
      rgxpChat: {
        raw: /(.)(.*)/,
        rawNick1: /^.*?display-name=(.*?);/,
        rawNick2: /^.*?user-type= :(.*?)!/,
        msg: /^.*?PRIVMSG #.*? :(.*)$/,
        pong: / PONG /,
        welcome: /:Welcome, GLHF!/,
        to: /^@(.*?),? /,
        link: /([a-z]{2,5}:\/\/[а-яa-z0-9]+?\.[а-яa-z0-9]{2,}\/?[^\s]*)/gi
      },
      timeout: (new Date).getTime(),
      connect: function() {try{
        this.socket=new WebSocket('ws://192.16.64.208:80/');
        this.socket.onopen=function(){
          this.interval.ping=setInterval(function() { this.socket.send('PING :tmi.twitch.tv') }.bind(this), 30000);
          this.interval.timeout=setInterval(function(){
            if((new Date).getTime() - this.timeout > 45000){
              console.log('twitch reconnect');
              this.socket.close();
              window.clearInterval(this.interval.ping);
              window.clearInterval(this.interval.timeout);
              this.connect()
            }
          }.bind(this), 60000);
          this.socket.send('CAP REQ :twitch.tv/tags twitch.tv/commands');
          this.socket.send('PASS blah');
          this.socket.send('NICK justinfan' + Math.round(Math.random()*999999));
          this.socket.send('JOIN #' + H.twitch);
        }.bind(this);
        //this.socket.onerror=function(e){console.log('error',e);alert(e)}.bind({w:w});
        this.socket.onmessage=function(e){this.message(e)}.bind(this);
      }catch(e){console.log(e)}},
      socket: null,
      interval: { ping: null, timeout: null },
      am: function(msg,chat) {try{
        let to = null, text;
        if(msg.to !== null) to = msg.to;
        text = msg.text.replace(chat.rgxpChat.link, '<a target="_blank" href="$1">&lt;link&gt;</a>');//.replace(chat.rgxpChat.smile, chat.smileReplacer.bind(chat));
        this.addMsg(msg.from, text, to, 'twitch')
      }catch(e){console.log(e)}},
      message: function(e) {try{
        //console.log(e)
        let r = e.data.match(this.rgxpChat.raw);
        if(r[1] === '@'){
          let nick = r[2].match(this.rgxpChat.rawNick1);
          if(nick === null || nick[1] === '')nick=r[2].match(this.rgxpChat.rawNick2);

          r = [nick, r[2].match(this.rgxpChat.msg)];
          if(r[0] !== null && r[1] !== null){
            let text = r[1][1], to = text.match(this.rgxpChat.to);
            if(to !== null) {
              text = text.replace(to[0], '');
              to = to[1]
            }
            this.am.call(A, {from: r[0][1], text: text, to: to}, this)
          }
        }
        else if(r[1] === ':'){
          if(this.rgxpChat.pong.test(r[2])) this.timeout = (new Date).getTime();
          //else if(this.rgxpChat.welcome.test(r[2])) this.sam('[<u>авторизованы</u>]',w)
        }
        //this.am.call(A,{from:'me',text:'zz :baban: zzz',to:'s.to'},this);
      }catch(e){console.log(e)}}
    },
    g: {
      rgxpChat: {
        nick: /^(.*?), /,
        smile: /:([a-z0-9]*?):/gi,
        link: /<a.*?href=".*?">.*?<\/a>/gi
      },
      smileReplacer: function(str,p1) {
        return '<img class="smile" src="http://goodgame.ru/images/smiles/'+p1+'.png">'
      },
      timeout: (new Date).getTime(),
      connect: function() {try{
        this.socket = new WebSocket('ws://chat.goodgame.ru:8081/chat/websocket');
        //this.socket.onerror=function(e){console.log('error',e);alert(e)}.bind({w:w});
        this.socket.onmessage = function(e){ this.message(e) }.bind(this);
        this.interval.timeout = window.setInterval(function() {
          if((new Date).getTime() - this.timeout > 30000){
            console.log('goodgame reconnect');
            this.socket.close();
            window.clearInterval(this.interval.timeout);
            this.connect()
          }
        }.bind(this), 30000);
      }catch(e){console.log(e)}},
      socket: null,
      interval: { timeout: null },
      am: function(msg,chat) {try{
        let to = null, text;
        if(msg.to !== null) to = msg.to;
        text = msg.text.replace(chat.rgxpChat.link, '<a target="_blank" href="$1">&lt;link&gt;</a>').replace(chat.rgxpChat.smile, chat.smileReplacer.bind(chat));
        this.addMsg(msg.from, text, to, 'goodgame')
      }catch(e){console.log(e)}},
      message: function(e) {try{
        //console.log(e)
        let o = JSON.parse(e.data);
        if(o.type === 'message'){
          let text = o.data.text,nick = o.data.text.match(this.rgxpChat.nick), to = null;
          if(nick !== null){
            to = nick[1];
            text = text.replace(nick[0], '')
          }
          this.am.call(A, {from: o.data.user_name, text: text, to: to}, this);
        }
        else if(o.type === 'channel_counters') {
          this.timeout = (new Date).getTime()
        }
        else if(o.type === 'welcome') {
          this.socket.send(JSON.stringify({'type': 'join', 'data': {'channel_id': H.goodgame}}))
        }
      }catch(e){console.log(e)}}
    }
  },
  connect: function(type) {
    this.sockConnect[type].connect()
  }
}
function api(l,d,f){try{GM_xmlhttpRequest({method: 'POST', url: 'https://funstream.tv/api/'+l, data: JSON.stringify(d), onload: f})}catch(e){console.log(e)}}
api('smile', {channel:'stream/' + H.sc2tv}, function(requ) {
  requ = JSON.parse(requ.responseText);
  for(let i = 0, l=requ.length; i<l; i++) {
    for(let j = 0, q = requ[i].length; j<q ; j++) A.sockConnect.f.smiles[requ[i][j].code] = requ[i][j].image
  }
});
A.init()